  input: '"TEXT","F3A","","This letter is in response to your inquiries dated 040202
    related to the year end report of David Vitter for Congress.  1. Schedule A appears
    to have contributions in excess of federal limits.  However, this is not the case
    as explained in detail below:  a.  Three names (Hebert, Meyer, & Triche) appear
    to be duplicate, but are not since each contribution is from a husband and his
    wife separately.  The confusion results from the wife using the husband''s name
    and including Mrs as a prefix.  b.  One of Mr. Vacarri''s contributions (121601)
    should have been for the 2002G not 2002P.  c.  Mr. Ward''s 120401 contribution
    should have been allocated $500 to the 2002P and $500 1999Debt.  The amendment
    filed as part of this letter should clarify the above matters.  Schedule D has
    been corrected and is included with this amended filing.  The information on Schedule
    D now includes the purpose of the loans and the correct name of the lender.  3.  The
    summary and detail summary page information in Column B should be the result of
    the previous report''s column b and current report''s column a.  However, this
    was our first time filing electronically and somehow the ending balances from
    the previous 063001 were not set up as the beginning balances for this report.  We
    have corrected the problem with the software vendor and this amended report should
    correct the problem on this report and all future reports.  William Vanderbrook,
    Treasurer, David Vitter for Congress"'
